// redirect login user to home page if it whosen't user
if (isAdminLoggedIn() || !isUserLoggedIn()) {
    redirect('Logout.php');
}
if (!isset($_GET['pid'])) {
    redirect('HPDashboard.php');
}
$isClicked = false;
$selectedMonth = '';
if (isset($_GET['pid']) && is_numeric($_GET['pid'])) {
    $year_months = getDateManths($_GET['pid']);
    if (count($year_months) > 0) { // to check that there are datarows of in the query result
        $selectedMonth = isset($_GET['mon']) ? $_GET['mon'] : $year_months[0]['mon_year'];
        $clickedPatientInfo = getclickedPatientInfo($_GET['pid'], $selectedMonth);
        if (count($clickedPatientInfo) > 0) {
            $isClicked = true;
            $clickedPatientInfoJson = json_encode($clickedPatientInfo, JSON_UNESCAPED_UNICODE);
        }
    }
} else {
    redirect('HPDashboard.php');
}

