    <script>
        var selectMonth = document.getElementById("selectMonth");
        selectMonth.addEventListener("change", function () {
            var selectedUrl = selectMonth.value;
            window.location.href = selectedUrl;
        });
        // Assign the JSON string to a JavaScript variable
        var clickedPatientInfoArray = <?php echo $clickedPatientInfoJson; ?>;
        clickedPatientInfoArray.reverse();
        console.log(clickedPatientInfoArray);
        var daysLabels = [];
        var catQuestionnaireData = [];
        var peakFlowData = [];
        var heartRateData = [];
        var oxygenSatData = [];
        var healthStatusData = [];
        var options = { day: 'numeric', month: 'numeric' };
        clickedPatientInfoArray.forEach(function (dataItem) {
            var date = new Date(dataItem.Date);
            var formattedDate = date.toLocaleDateString('en-US', options);
            daysLabels.push(formattedDate);
            catQuestionnaireData.push(dataItem.CAT_questionnaire);
            peakFlowData.push(dataItem.Peak_flow);
            heartRateData.push(dataItem.Heart_rate);
            oxygenSatData.push(dataItem.Oxygen_sat);
            healthStatusData.push(dataItem.Health_status);
        });
    </script>
